import React, { createContext, useState, useEffect } from "react";
import axios from "axios";

function Test() {

    const [mainText, subText] = useState([]);

    useEffect(() => {
        const getData = async () => {
            try {
                const res = await axios.get("http://127.0.0.1:8000/sample/",)
                console.log(res);
            } catch {
                console.log("error !!");
            }
        };
    })

    return (
        <div>
            <h1>This is Test Page</h1>
        </div>
    )
}

export default Test;
